/*
* Use for handling Click and Touch Event for better performance in iOS devices
* REF: Pluralsight - Knockout Fundamentals - 3. Bindings - 12. Custom Bindings Demo
*/

ko.bindingHandlers.iclick = {
    init:
        function (element, valueAccessor, allBindingsAccessor, viewModel) {
            var method = valueAccessor();
            var onClick = function (event) {
                event.stopPropagation();
                event.preventDefault();
                method.call(viewModel);
            }
            element.addEventListener('touchstart', onClick, false);
            element.addEventListener('click', onClick, false);
        }
}

/*
* Use Formatting Date/Time based on MomentJs.com
*/

ko.bindingHandlers.iDateTime = {
    update: 
        function (element, valueAccessor, allBindingsAccessor) {
            var value = ko.utils.unwrapObservable(valueAccessor());
            var format = ko.utils.unwrapObservable(allBindingsAccessor().format)
            format = format || ko.bindingHandlers.iDateTime.defaultFormat;
            var result = moment(value).format(format);
            // NOTE: Use innerHTML instead to be able to put RAW html in result.
            // ko.bindingHandlers.text.update(element, function () { return result; });
            element.innerHTML = result;
        },
    defaultFormat: "YYYY-MM-DD"
}

/*
* Use for Toggling Class on condition
* This will add class "Active" when value is true and "InActive" when it's false
*/

ko.bindingHandlers.iToggle = {
    update:
        function (element, valueAccessor, allBindingsAccessor) {
            var value = AppViewModel.Nav.params().view == ko.utils.unwrapObservable(valueAccessor());
            var classOn = ko.utils.unwrapObservable(allBindingsAccessor().on) || "Active";
            var classOff = ko.utils.unwrapObservable(allBindingsAccessor().off) || "InActive"

            if (value) { $(element).addClass(classOn).removeClass(classOff); }
            else { $(element).addClass(classOff).removeClass(classOn); }
        }
}

ko.bindingHandlers.iSwitch = {
    update:
        function (element, valueAccessor, allBindingsAccessor) {
            var value = AppViewModel.Nav.params().view == ko.utils.unwrapObservable(valueAccessor());
            var classOn = ko.utils.unwrapObservable(allBindingsAccessor().on) || "On";

            if (value) { $(element).addClass(classOn); }
            else { $(element).removeClass(classOn); }
        }
}
